function Content({page}) {
    const pages = {
        "Sobre": <Sobre />,
        "Lista de Livros": <ListaDeLivros />,
        "Cadastrar": <Cadastrar />
    };

    return (
        <div className="row m-3">
            {pages[page] || <p>Página não encontrada</p>}
        </div>
    );
};

export default Content;
